import React from "react";
import "../css/home.css";
import { Grid } from "@material-ui/core";

const Home = () => {
    return (
        <>
            <Grid container className="computer">
                <Grid container item xs={12}>
                    <Grid item xs={6} alignContent="flex-end">
                        <h1 className="title">Maxence</h1>
                    </Grid>
                    <Grid item xs={6}>
                        <h1 className="title">Liboz</h1>
                    </Grid>
                </Grid>
            </Grid>
        </>
    );
};

export default Home;
